import { FaShoppingCart, FaUser } from "react-icons/fa";
import logo from "../assets/logo.png";

const Header = () => {
  return (
    <body>
      <header>
        <div>
          <img src="../assets/logo.png" alt="" />
          ProShop
        </div>
      </header>
    </body>
  );
};

export default Header;
